function ReservationSummary() {
    return (
        <div className="box">
            <div className="row">
                <p>Nights stayed: 3</p>
                <p>$130.0 per night</p>
            </div>
            <div className="row">
                <p>Total Stay Cost:</p>
                <p>$390.0</p>
            </div>
        </div>
    );
};

export default ReservationSummary;
